X06_M02_010 = {
  {text = '<LOC X06_M02_010_010>[{i HQ}]: A Seraphim commander is blocking your route to the Arch. Defeat that alien\'s forces and then move on the Arch. HQ out.', vid = 'X06_HQ_M02_04473.sfd', bank = 'X06_VO', cue = 'X06_HQ_M02_04473', faction = 'NONE'},
