  {text = '<LOC X06_M02_010_030>[{i Fletcher}]: Why should I help you? You\'re no different from the rest of them. Once this over, you\'re going to turn on us.', vid = 'X06_Fletcher_M02_04475.sfd', bank = 'X06_VO', cue = 'X06_Fletcher_M02_04475', faction = 'UEF'},
