  {text = '<LOC X06_M02_010_060>[{i Hall}]: What the hell are you talking about? Black Sun is destroyed. The Aeon and Cybran are our allies.', vid = 'X06_Hall_M02_04478.sfd', bank = 'X06_VO', cue = 'X06_Hall_M02_04478', faction = 'UEF'},
  {text = '<LOC X06_M02_010_070>[{i Fletcher}]: You fool. They\'re scheming and plotting right under your nose, and you\'re too blind to notice.', vid = 'X06_Fletcher_M02_04479.sfd', bank = 'X06_VO', cue = 'X06_Fletcher_M02_04479', faction = 'UEF'},
